import React from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';

class Home extends React.Component{

    state = {
        posts: []
      }

      componentDidMount() {
        axios.get("http://localhost:8080/clinicalservices/api/patient")
          .then(res => {
            const posts = res.data.data.children.map(obj => obj.data);
            this.setState({ posts });
          });
      }

      render() {
        const { patientData } = this.state;
        console.log(patientData)
        return (
          <div>
            <p>API call :</p>
            Todo title : <p>{patientData.lastName}</p>
            Todo completed : <p>{patientData.firstName}</p>
          </div>
        );
      }
    }

export default Home;
